import './style/ExpenseItem.css'

const ExpenseItem = () => {
  return (
    <div className="expense-item">
      <div>March 28</div>
      <div className='expense-item-description'>
        <div>Car Insurance</div>
        <div className='expense-item-price'>270</div>
      </div>
    </div>
  );
};

export default ExpenseItem;
